const sadCry = ``;

const happyCry = [
    ``,
    ``,
    ``
];
var scream;
function playSound(sound) {
    if (scream && !scream.paused) {
        return;
    }
    scream = new Audio('data:audio/mp3;base64,' + sound);
    scream.play();
}

document.addEventListener('DOMContentLoaded', function() {
    const pikachu = document.getElementById('pikachu');
    pikachu.addEventListener('click', function(e) {
        if (e.target && e.target.matches('pikachu-eye')) {
            playSound(sadCry);
        } else {
            playSound(happyCry[parseInt(Math.random() * happyCry.length)]);
        }
    });
}, false);